import React from 'react';
import ayungonLogo from '../assets/ayungonLogo.png';
import MayorDennis from '../assets/MayorDennis.jpg';
const Officials = () => {
	return (
		<div>
			{/* Ayungon Logo */}
			<div className="relative bg-green-500 mx-20 mt-5	">
				<div className="flex flex-row justify-start gap-5 pt-10a">
					<div className="flex justify-start">
						<img
							className="w-32"
							src={ayungonLogo}
							alt="Ayungon Logo"
						/>
					</div>
					<div className="flex  pt-5 font-Cinzel font-bold text-4xl flex-col  	">
						<h1>Municipality Of Ayungon</h1>
						<h1>Officials</h1>
					</div>
				</div>
				{/* Ayungon Logo */}

				<div className="">
					<div>
						<div className="">
							<img src={MayorDennis} />
						</div>
						<div></div>
					</div>
				</div>
			</div>
		</div>
	);
};

export default Officials;
